import React from "react";

class ProjectPreview extends React.Component {

  render() {
      const { logoUrl } = this.props;

      return (
        <div>
          <img src={logoUrl} />
          <h1>{this.props.name}</h1>
          <h2>{this.props.description}</h2>
        </div>
      );
  }
}

export default ProjectPreview
